Storyline:

   In the early years of the 20th century, Matt Masters takes his rambling Wild West Show to Europe. His decision is prompted by his desire to find Lili Alfredo, who disappeared fourteen years earlier following the death of her husband, The Flying Alfredo. At the time it was believed that Alfredo dove to his death deliberately when he realized his wife loved Matt and not him. Toni, a beautiful trapeze performer, raised by Matt is actually Lili's daughter, and she is in love with Steve McCabe, one of the stars on Matt's show. Doing their first show in Barcelona, aboard a ship, the ship keels over and Matt loses his show. Now broke, he leaves for Paris with Toni, Steve and his long-time friend, Cap Carson, to seek a job with Colonel Purdy's Wild West Show. But a year later, Matt has rebuilt his own show. First to be signed is a remarkable 12-year-old wire-walker named Giovana, and her guardian, Tojo the Clown, whose real named is Aldo Alfredo, formerly of the Flying Alfredos.


